export default (state = {}, { type, payload }) => {
    switch (type) {
      case 'SET_USER':
        return payload;
      case 'CLEAR_USER':
        return {};
      case 'SET_LANGUAGE_LIST_RESPONSE':
        return {
          ...state,
          languageListResponse : payload
        }
      default:
        return state;
    }
  };
